import Header from './components/header';
import List from './components/list';
import Data from './components/data';
import './css/myStyle.css'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<div>
   <Header/>
   <List/><br></br>
   <Data/>
</div>
);
